const ITER=600000;

function b64dec(s){return Uint8Array.from(atob(s),c=>c.charCodeAt(0));}

async function derive(pw){
  const enc=new TextEncoder().encode(pw);
  const base=await crypto.subtle.importKey("raw",enc,"PBKDF2",false,["deriveKey"]);
  return crypto.subtle.deriveKey(
    {name:"PBKDF2",salt:b64dec(SALT),iterations:ITER,hash:"SHA-256"},
    base,{name:"AES-GCM",length:256},false,["decrypt"]
  );
}

async function go(){
  const pw=document.getElementById("pw").value;
  if(!pw)return;
  document.getElementById("btn").textContent="Decrypting...";
  document.getElementById("err").textContent="";
  try{
    const key=await derive(pw);
    const dec=await crypto.subtle.decrypt(
      {name:"AES-GCM",iv:b64dec(IV)},key,b64dec(CT)
    );
    const html=new TextDecoder().decode(dec);
    if(document.getElementById("rem").checked){
      try{localStorage.setItem("ct_pw",pw);}catch(e){}
    }
    document.open();document.write(html);document.close();
  }catch(e){
    document.getElementById("err").textContent="Wrong password";
    document.getElementById("btn").textContent="Enter";
  }
}

document.getElementById("pw").addEventListener("keydown",e=>{if(e.key==="Enter")go();});

// Auto-unlock if remembered
(async()=>{
  try{
    const saved=localStorage.getItem("ct_pw");
    if(saved){document.getElementById("pw").value=saved;go();}
  }catch(e){}
})();
</script>
